// src/pages/Dashboard.jsx
import React, { useEffect, useState, useRef } from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const [userEmail, setUserEmail] = useState('');
  const [userPassword, setUserPassword] = useState('');
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [commissionData, setCommissionData] = useState([]);
  const [arSvData, setArSvData] = useState([]);
  const arSvIndexMapRef = useRef({});
  const navigate = useNavigate();

  useEffect(() => {
    const storedEmail = localStorage.getItem('userEmail');
    const storedPassword = localStorage.getItem('userPassword');
    if (storedEmail && storedPassword) {
      setUserEmail(storedEmail);
      setUserPassword(storedPassword);
    }
  }, []);

  useEffect(() => {
    if (userEmail && userPassword) {
      fetch('https://script.google.com/macros/s/AKfycbzSjgMyzv1ciX5MeW_f5Doh9gWydDGpN2Txz8gUSdf1nNq8TpxWlyyGFvJCbG-QwJM4/exec')
        .then((res) => res.json())
        .then((data) => {
          console.log('Commission Sheet Data:', data);

          const normalizedData = data.map((item) =>
            Object.fromEntries(
              Object.entries(item).map(([key, value]) => [key.toLowerCase().trim(), value])
            )
          );

          const matchedUser = normalizedData.find(
            (item) =>
              item.emails?.toLowerCase().trim() === userEmail.toLowerCase().trim() &&
              item.passwords?.trim() === userPassword.trim()
          );

          if (matchedUser) {
            setIsAuthenticated(true);
            const filtered = normalizedData.filter(
              (item) => item.emails?.toLowerCase().trim() === userEmail.toLowerCase().trim()
            );
            setCommissionData(filtered);
          } else {
            console.log('No matched user found');
            setIsAuthenticated(false);
          }
        });

      fetch('https://script.google.com/macros/s/AKfycbw5FIPX_XqlxHqwEuZZqugW0cwNG1zk2SI28q8ri0cm7XDDEkZ1ncgUk5v6ZMGrvpJp/exec')
        .then((res) => res.json())
        .then((data) => {
          const [headers, ...rows] = data;
          const indexMap = headers.reduce((acc, key, i) => {
            acc[key.toLowerCase()] = i;
            return acc;
          }, {});
          arSvIndexMapRef.current = indexMap;

          const filtered = rows.filter(
            (row) =>
              row[indexMap['emails']]?.toLowerCase().trim() === userEmail.toLowerCase().trim()
          );
          setArSvData(filtered);
        });
    }
  }, [userEmail, userPassword]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    localStorage.removeItem('userPassword');
    setUserEmail('');
    setUserPassword('');
    setIsAuthenticated(false);
    navigate('/');
  };

  return (
    <div style={{ padding: '2rem' }}>
      {isAuthenticated ? (
        <>
          <h2>Welcome, {userEmail}</h2>
          <button onClick={handleLogout}>Logout</button>

          <h3>Your Weekly Commission</h3>
          {commissionData.length > 0 ? (
            <ul>
              {commissionData.map((entry, index) => (
                <li key={index}>
                  <strong>Week:</strong> {entry.commissionweek} | <strong>Region:</strong> {entry.region} <br />
                  <strong>New Business:</strong> {entry.newbusiness} | <strong>Rewrite:</strong> {entry.rewrite} | <strong>Total NBs:</strong> {entry.totalnbs} <br />
                  <strong>Gross Pay:</strong> ${entry.grosspay} | <strong>Bonus Tier:</strong> {entry.bonustier} | <strong>Total Bonus:</strong> ${entry.totalbonus}
                </li>
              ))}
            </ul>
          ) : (
            <p>No commission data found.</p>
          )}

          <h3>Your Scanning Violations & ARs</h3>
          {arSvData.length > 0 ? (
            <ul>
              {arSvData.map((row, index) => {
                const map = arSvIndexMapRef.current;
                const isAR = row[map['arfeeamount']];
                const isSV = row[map['svfeeamount']];

                return (
                  <li key={index}>
                    <strong>Week:</strong> {row[map['week']]}<br />
                    {isAR && (
                      <>
                        <strong>Type:</strong> AR | <strong>Customer:</strong> {row[map['arcustomername']]} | <strong>Amount:</strong> ${row[map['arfeeamount']]}<br />
                        <strong>Details:</strong> {row[map['ardetails']]}<br />
                      </>
                    )}
                    {isSV && (
                      <>
                        <strong>Type:</strong> Scanning Violation | <strong>Customer:</strong> {row[map['svcustomername']]} | <strong>Amount:</strong> ${row[map['svfeeamount']]}<br />
                        <strong>Details:</strong> {row[map['svdetails']]}<br />
                      </>
                    )}
                  </li>
                );
              })}
            </ul>
          ) : (
            <p>No violations or ARs found.</p>
          )}
        </>
      ) : (
        <h2>Unauthorized: Please check your login credentials.</h2>
      )}
    </div>
  );
};

export default Dashboard;
